                    </div>
                </div>
                <div className="text-div">
                    <p className="bottom-title-apartment">{number_of_room + ' room'} {number_of_bath + ' bath'} {sqft ? sqft + ' sqft' : ""} </p>
                    <p className="address">{address}</p>
                </div> */}
            </div>
        );
    }
}

export default Apartments;
